import React from 'react';
import './Dividers.css';
import Divider from '../Divider/Divider';

const Dividers = (props) => {
  console.log(props);
  return (
    <div className="dividers">
      {props.dividers.map(function (value, index) {
          var className = props.state.clicked !== undefined ? 'click-state' : 'base-state';
          return <Divider divider={value} className={className} items={props.items} key={index} onDividerClick={props.onDividerClick}></Divider>;
      })}
    </div>
  );
}

export default Dividers;
